import React from 'react'
import './next-jsoneditor.css'
import { JsonEditor } from 'nextjs-jsoneditor'

const App = () => {
  return (
    <div>
      <h2>App JS</h2>
      <JsonEditor
        value={{
          name: 'raja',
          age: '20',
          sex: 'male'
        }}
      />
    </div>
  )
}

export default App
